    [],nt"num_tags": 4,nt"name": "a-narrative-report-mingo-national-wildlife-refuge-september-through-december-1949",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Mingo National
    Wildlife Refuge outlines Refuge accomplishments from September through December
    of 1949. The report begins by summarizing the weather conditions, water conditions,
    and fire during this period. Wildlife- including migratory birds, upland game birds,
    big game animals, furbearers, predators, rodents, raptors, and fish- is also covered.
    The Refuge development section discusses physical developments and plantings. Resource
    management is outlined; topics include timber removal. A progress report on field
    investigations and applied research is included. The public relations section discusses
    recreational uses, Refuge visitors, Refuge participation, hunting, and violations.
